import React from "react";
import ".././output.css";
import Logo from "../Assets/Logos/vector.";

function LogoSvg(props) {
  return (
    <div
      className={`w-${props.w} h-${props.w} ml-2 flex justify-left overflow-hidden`}
    >
      <img src={Logo} alt="Logo" width={props.w} height={props.h} />
    </div>
  );
}

export default LogoSvg;
